import React,{Component} from "react";

class Hello extends Component{
    constructor(props){
        super(props)

    }
    componentWillUnmount(){
        alert('The component is going to be unmounted');
    }

    render(){
        return <h1 display={this.props.display}>Hello Word!!!</h1>
    }
}

export default Hello;
